import React, { useEffect, useState } from 'react';
import "./Navbar.css";

const Navbar = () => {

    const [navbar, setNavbar] = useState(false);

    const changeNavbar = () => {
      if (window.scrollY >= 20) {
        setNavbar(true);
      } else {
        setNavbar(false);
      }
    }

    window.addEventListener('scroll', changeNavbar);

    return (
      <nav className="navbar navbar-light navbar-expand-md px-4" style={{
        background: navbar ? 'rgba(80, 80, 100, 1)' : 'none',
        position: 'fixed',
        width: '100%',
        zIndex: 200,
      }}>
        <div className="container-fluid nav-container">
          <a className="navbar-brand text-white d-flex flex-row align-items-center" href="#">
          <i className="fa fa-film logo pe-1 " aria-hidden="true"></i>
          <div className="logo text-white">Critic</div>
          </a>

          <button class="navbar-toggler me-auto" type="button" data-bs-toggle="collapse" data-bs-target="#navbarText" aria-controls="navbarText" aria-expanded="false" aria-label="Toggle navigation">
          <i className="fa fa-bars nav-icon" aria-hidden="true"></i>
          </button>


          <div className="me-auto d-none d-md-flex">
            <button className="btn-small">
              Movies
            </button>

            <button className="btn-small">
              TV Shows
            </button> 
          </div>






          <i class="fa fa-ticket nav-icon" aria-hidden="true"></i>
          <button className="btn-small mx-1 xs-hidden">
            Sign Up
          </button>
          <button className="btn-login xs-hidden">
              Login
          </button>

        </div>
        <div class="collapse navbar-collapse p-1 p-md-0" id="navbarText">
          <ul class="navbar-nav me-auto mb-0 d-inline d-md-none">
            <li class="nav-item">
              <button className="btn-small">
                Movies
              </button>
            </li>
            <li class="nav-item">
            <button className="btn-small me-auto">
                TV Shows
              </button>
            </li>
          </ul>
        </div>


      </nav>
    )
}

export default Navbar;
